import React from "react";
import { useState, useEffect } from "react";
import axios from "axios";

// fetch('http://api-sousmontoit.am.manusien-ecolelamanu.fr/public/staff').then((response) => {
//     console.log(response);
// })

const StaffList = () => {
  const [staffData, setStaffData] = useState({});
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    axios
      .get("http://api-sousmontoit.am.manusien-ecolelamanu.fr/public/staff")
      .then((res) => {
        // console.log('coucou');
        setStaffData(res.data);
      })
      .catch((error) => {
        console.log("coucou 2");
        console.log(error.message);
      })
      .finally(() => {
        setLoading(false);
      });
  }, []);
  if (loading) {
    return <p>Chargement en cours..</p>;
  }
  return (
    <div className="container">
      <div className="card">
        <img src="/staff1.jpg" className="col-2" alt="..." />
        <div className="card-body">
          <h5 className="card-title">Card title</h5>
          <p className="card-text text-dark">
            Pr√©nom: {staffData[0].firstname}{" "}
          </p>
        </div>
      </div>
    </div>
  );
};

export default StaffList;
